"use strict";

function sortEvenOdd(nums) {
    let a = nums.filter((_, i) => i % 2 === 0).sort((a, b) => a - b);
    let b = nums.filter((_, i) => i % 2 !== 0).sort((a, b) => b - a);
    for (let i = 0; i < nums.length; i++) {
        if (i % 2 === 0) {
            nums[i] = a[i / 2];
        } else {
            nums[i] = b[(i - 1) / 2];
        }
    }
    return nums;
}
